[{"location":"solver/#Setting-up-a-solver","page":"Setting up a solver","title":"Setting up a solver","text":"","category":"section"},{"location":"#EO","page":"EO","title":"EO","text":"","category":"section"},{"location":"","page":"EO","title":"EO","text":"This is a Julia library for evolutionary optimization. The library was written mainly with focus on flexibility of a solver, whose behaviour (the evolution strategy) is defined by user supplied functions as arguments (eg, crossover function etc.).","category":"page"},{"location":"#Installation","page":"EO","title":"Installation","text":"","category":"section"},{"location":"","page":"EO","title":"EO","text":"Install the package by running using Pkg; Pkg.add(\"https://github.com/BipoaroXigen/SPJ_TEST\") or ]add https://github.com/BipoaroXigen/SPJ_TEST in REPL.","category":"page"},{"location":"#Examples-of-use","page":"EO","title":"Examples of use","text":"","category":"section"},{"location":"","page":"EO","title":"EO","text":"We provide several jupyter notebooks which help the user see how the library can be utilized. The notebooks can be found in the directory notebooks.","category":"page"},{"location":"#Showcase-of-basic-optimalization-problems-solvers","page":"EO","title":"Showcase of basic optimalization problems solvers","text":"","category":"section"},{"location":"","page":"EO","title":"EO","text":"The notebook zoo.ipynb demonstrates the how the EO library can be used to solve variou types of optimization problems, such as optimization of simple function, multiobjective function, or symbolic regression by Genetic Programing.","category":"page"},{"location":"#Solving-the-TSP-problem","page":"EO","title":"Solving the TSP problem","text":"","category":"section"},{"location":"","page":"EO","title":"EO","text":"The notebook TSP.ipynb demonstrates the use and performance of the library when applied to the TSP problem. The solved TSP problems are from the web page: http://comopt.ifi.uni-heidelberg.de/software/TSPLIB95/tsp/ . The notebook expects the instances in a folder TSP_problems/.","category":"page"},{"location":"#Multiobjective-optimization","page":"EO","title":"Multiobjective optimization","text":"","category":"section"},{"location":"","page":"EO","title":"EO","text":"The notebook multiobjective.ipynb demonstrates the use and performance of the library when applied to constrained analytical optimization problems. And the definitions of some problems are already prepared in the code.","category":"page"},{"location":"#Optimization-of-constrained-functions","page":"EO","title":"Optimization of constrained functions","text":"","category":"section"},{"location":"","page":"EO","title":"EO","text":"The notebook constrained_optimization.ipynb demonstrates the use and performance of the library when applied to constrained analytical optimization problems. The solved TSP problems are from the web page: https://cw.fel.cvut.cz/wiki/media/courses/a0m33eoa/cviceni/2006problemdefinitionsandevaluationcriteriaforthecec2006specialsessiononconstraintreal-parameteroptimization.pdf. And the definitions of some problems are already prepared in the code.","category":"page"},{"location":"#Algorithmic-trading","page":"EO","title":"Algorithmic trading","text":"","category":"section"},{"location":"","page":"EO","title":"EO","text":"The folder trading contains notebooks of an algorithmic trading project, built with this library.","category":"page"}]
